import React from "react";
import { useSelector } from "react-redux";

function Profile() {
  const { name, age, status } = useSelector((state) => {
    return state;
  });
  return (
    <div>
      <h1>I am {name}</h1>
      <h1>My age is  {age}</h1>
      <h1>My status is  {status}</h1>
    </div>
  );
}

export default Profile;
